import React, { Component } from 'react';
import Layout from '../components/Layout';
import web3 from '../ethereum/web3';
import cookies from 'next-cookies';

class LeaderboardPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      login: false,
      loading: true,
      accountType: null
    };
  }
}
